import React, { useState, useEffect } from 'react';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const [activeDropdown, setActiveDropdown] = useState(null);

  useEffect(() => {
    const handleScroll = () => {
      const scrollTop = window.scrollY;
      setIsScrolled(scrollTop > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
    setIsMenuOpen(false);
    setActiveDropdown(null);
  };

  const toggleDropdown = (dropdown) => {
    setActiveDropdown(activeDropdown === dropdown ? null : dropdown);
  };

  return (
    <nav className={`fixed w-full top-0 z-50 transition-all duration-300 ${
      isScrolled 
        ? 'bg-gradient-to-r from-white/95 to-gray-50/95 backdrop-blur-md shadow-lg py-3' 
        : 'bg-gradient-to-r from-white/90 to-gray-50/90 backdrop-blur-sm py-4'
    }`}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center">
          {/* Logo */}
          <div className="flex items-center">
            <div className="flex items-center space-x-3">
              <img 
                src="/maxresdefault.jpg" 
                alt="Manaslu Cafe Logo" 
                className={`rounded-lg transition-all duration-300 ${
                  isScrolled 
                    ? 'h-10 w-auto' 
                    : 'h-12 w-auto'
                }`}
              />
              <div className="hidden sm:block">
                <h1 className={`font-bold transition-all duration-300 ${
                  isScrolled ? 'text-lg text-gray-800' : 'text-xl text-gray-800'
                }`}>
                  Manaslu Cafe
                </h1>
              </div>
            </div>
          </div>

          {/* Desktop Menu */}
          <div className="hidden lg:flex items-center space-x-8">
            <button
              onClick={() => scrollToSection('home')}
              className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 font-medium text-sm relative group"
            >
              Home
              <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-cafe-brown transition-all duration-200 group-hover:w-full"></span>
            </button>
            
            <button
              onClick={() => scrollToSection('menu')}
              className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 font-medium text-sm relative group"
            >
              Menu
              <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-cafe-brown transition-all duration-200 group-hover:w-full"></span>
            </button>

            {/* Services Dropdown */}
            <div className="relative">
              <button
                onClick={() => toggleDropdown('services')}
                className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 font-medium text-sm flex items-center space-x-1 relative group"
              >
                <span>Services</span>
                <svg 
                  className={`w-4 h-4 transition-transform duration-200 ${
                    activeDropdown === 'services' ? 'rotate-180' : ''
                  }`} 
                  fill="none" 
                  stroke="currentColor" 
                  viewBox="0 0 24 24"
                >
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
                <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-cafe-brown transition-all duration-200 group-hover:w-full"></span>
              </button>
              
              {activeDropdown === 'services' && (
                <div className="absolute top-full left-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-2 z-50">
                  <button
                    onClick={() => scrollToSection('menu')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Food Menu
                  </button>
                  <button
                    onClick={() => scrollToSection('menu')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Catering
                  </button>
                  <button
                    onClick={() => scrollToSection('menu')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Delivery
                  </button>
                </div>
              )}
            </div>

            {/* Locations Dropdown */}
            <div className="relative">
              <button
                onClick={() => toggleDropdown('locations')}
                className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 font-medium text-sm flex items-center space-x-1 relative group"
              >
                <span>Locations</span>
                <svg 
                  className={`w-4 h-4 transition-transform duration-200 ${
                    activeDropdown === 'locations' ? 'rotate-180' : ''
                  }`} 
                  fill="none" 
                  stroke="currentColor" 
                  viewBox="0 0 24 24"
                >
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
                <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-cafe-brown transition-all duration-200 group-hover:w-full"></span>
              </button>
              
              {activeDropdown === 'locations' && (
                <div className="absolute top-full left-0 mt-2 w-48 bg-white rounded-lg shadow-lg border border-gray-200 py-2 z-50">
                  <button
                    onClick={() => scrollToSection('contact')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Kathmandu Valley
                  </button>
                  <button
                    onClick={() => scrollToSection('contact')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Pokhara
                  </button>
                  <button
                    onClick={() => scrollToSection('contact')}
                    className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-50 hover:text-cafe-brown transition-colors duration-200"
                  >
                    Chitwan
                  </button>
                </div>
              )}
            </div>
            
            <button
              onClick={() => scrollToSection('contact')}
              className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 font-medium text-sm relative group"
            >
              Contact
              <span className="absolute -bottom-1 left-0 w-0 h-0.5 bg-cafe-brown transition-all duration-200 group-hover:w-full"></span>
            </button>
          </div>

          {/* Mobile Menu Button */}
          <div className="lg:hidden">
            <button
              onClick={toggleMenu}
              className="text-gray-700 hover:text-cafe-brown transition-colors duration-200 focus:outline-none"
            >
              <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                {isMenuOpen ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="lg:hidden bg-white/95 backdrop-blur-md border-t border-gray-200 mt-2 rounded-lg shadow-lg mx-2">
            <div className="px-6 pt-6 pb-8 space-y-1">
              <button
                onClick={() => scrollToSection('home')}
                className="block px-4 py-3 text-gray-700 hover:text-cafe-brown hover:bg-gray-50 rounded-lg w-full text-left transition-all duration-200 font-medium"
              >
                Home
              </button>
              <button
                onClick={() => scrollToSection('menu')}
